const initialState = [];

const addToCart = (state = initialState, action) => {
  switch (action.type) {
    case "addtocart":
      const data = action.payload;
      console.log(action.payload);
      console.log(state)
      return [...state,data];
    default:
      return state;
  }
};

export default addToCart;
